Certainly! Below is a LaTeX code snippet using TikZ and pgfplots to create a 2D plot as per your specifications. This code will produce a professional-looking plot suitable for a printed book.

```latex
\documentclass{standalone}
\usepackage{tikz}
\usepackage{pgfplots}
\usetikzlibrary{patterns}

\begin{document}

\begin{tikzpicture}
    % Define colors
    \definecolor{palered}{RGB}{255,200,200}
    \definecolor{grayline}{RGB}{150,150,150}

    % Plot settings
    \begin{axis}[
        axis lines = middle,
        xlabel = $x$,
        ylabel = $y$,
        xmin=0, xmax=10,
        ymin=0, ymax=10,
        grid = major,
        grid style={dashed, gray!30},
        width=10cm,
        height=10cm,
        tick label style={font=\footnotesize},
        axis line style={thick},
        axis line style={->},
        xtick={0,2,4,6,8,10},
        ytick={0,2,4,6,8,10},
        samples=100,
        domain=0:10
    ]

    % Points
    \node[circle, draw, fill=black, inner sep=1pt] (x) at (4,4) {$x$};
    \node[circle, draw, fill=blue, inner sep=1pt] (y1) at (2,6) {$y_1$};
    \node[circle, draw, fill=green, inner sep=1pt] (y2) at (6,2) {$y_2$};
    \node[circle, draw, fill=red, inner sep=1pt] (y3) at (8,8) {$y_3$};

    % Dashed lines through x
    \draw[grayline, dashed] (axis cs:4,0) -- (axis cs:4,10);
    \draw[grayline, dashed] (axis cs:0,4) -- (axis cs:10,4);

    % Shaded region
    \fill[pattern=north east lines, pattern color=palered, draw=none] (axis cs:4,4) -- (axis cs:10,10) -- (axis cs:10,4) -- cycle;

    % Dominance lines
    \draw[->, thick] (x) -- (y1);
    \draw[->, thick] (x) -- (y2);
    \draw[->, thick] (x) -- (y3);

    \end{axis}
\end{tikzpicture}

\end{document}
```

### Explanation:

- **Colors and Styles**: Defined colors for the shaded region and dashed lines using RGB values for a professional look.
- **Points**: Placed points \( x \), \( y_1 \), \( y_2 \), and \( y_3 \) with different colors for distinction.
- **Dashed Lines**: Added gray dashed lines through point \( x \) to indicate axis-parallel lines.
- **Shaded Region**: Used a pattern to shade the top-right region of \( x \) with a pale red color.
- **Dominance Lines**: Drawn arrows from \( x \) to each \( y_i \) to indicate dominance.

